import React from 'react';
import Head from 'next/head';

const Signup = () => {
    return (
    <>
        <Head>
            <title>NodeBird 회원가입</title>
        </Head>
        <AppLayout>내 프로필</AppLayout>
    </>
    )
};

export default Signup;
